import React from 'react';
import './css/Form.css';
import Input from './Input';
import Parse from 'parse';

export default class Form extends React.Component{

    constructor(props){
        super(props);
        this.state = { email: '', password: '', type: 'password' };
        this.set = this.set.bind(this);
    }

    logInUser(){
        alert(new String(this.state.email));
        let user = Parse.User.logIn(toString(this.state.email), toString(this.state.password))
        .then(
            (result) => {
                alert('Welcome');
            },
            (err) => {
                alert(err.message);
            }
        );
    }

    set(value, typeInput){
        if(typeInput === 'email'){
            this.setState({email: value});
        }else{
            this.setState({password: value});
        }
    }

    changeVisibilityPass(){
        let type = '';
        if(this.state.type === 'password'){
            type = 'text';
        }else{
            type = 'password';
        }
        this.setState({type});
    }

    render(){
        /*
            <input type="text" value={this.state.email}
                        onChange={() => {this.setEmail(this.value)}}/>
                    <p>Senha</p>
                    <input type={this.state.type} value={this.state.senha}
                        onChange={() => {this.setSenha(this.value)}}/>
        */
        return(
            <header className="form-render">
                <p>Orange</p>
                <form>
                    <p>Email</p>
                    <Input type='text' value={this.state.email} typeInput='email' set={this.set}/>
                    <p>Senha</p>
                    <Input type={this.state.type} value={this.state.password} typeInput='password' set={this.set}/>
                    <input type="checkbox" onChange={() => {this.changeVisibilityPass()}}/> Mostrar senha
                    <p>Problemas para acessar a conta ?</p>
                    <input type="button" value="Acessar" onClick={() => {this.logInUser()}}/>
                </form>
                <p>ou</p>
                <input type="button" value="Cadastrar" />
            </header>
        );
    }
}
